sys_variable_value.value:
(function execute(inputs, outputs) {
var bodyObject=inputs.responseBody;
  outputs.customerId=bodyObject.customerId;
  outputs.orderNumber=bodyObject.orderNumber;
  outputs.orderDate=bodyObject.orderDate;
  outputs.statusCode=bodyObject.statusCode;
  outputs.statusMessage=bodyObject.statusMessage;
  outputs.orderLines=bodyObject.orderLines;
})(inputs, outputs);

